import React from 'react';

class BotaoEntrar extends React.Component {
    constructor(props) {
        super(props)
        this.buttonEnter =this.buttonEnter.bind(this);
    }

    buttonEnter() {
        const { history } = this.props
        history.push('/carteira')
    }
    render() {

        return (
            <button onClick={this.buttonEnter} type="button">Entrar</button>
        )
    }
}

export default BotaoEntrar;
